import { useState, useEffect } from "react";
import Wrapper from "../styled-components/Wrapper";
import Hero from "../styled-components/Hero";
import Footer from "../styled-components/Footer";
import Language from "../styled-components/Language";
import HeroEN from "../styled-components/HeroEN";
import Form from "../styled-components/Form";
import Input from "../styled-components/Input";
import Button from "../styled-components/Button";
import Quote from "../styled-components/Quote";

function Registro() {
  const [language, setLanguage] = useState("español");

  useEffect(() => {
    (() => {
      if (localStorage.getItem("bajoNaranja")) {
        setLanguage(JSON.parse(localStorage.getItem("bajoNaranja")).language);
      }
    })();
  }, []);

  function languageChange() {
    if (language === "english") {
      localStorage.removeItem("bajoNaranja");
      return window.location.reload();
    }
    localStorage.setItem(
      "bajoNaranja",
      JSON.stringify({ language: "english" })
    );
    return window.location.reload();
  }

  function showText() {
    return (document.getElementById("textContainer").style.opacity = 1);
  }

  return (
    <Wrapper>
      <Language onClick={languageChange}>{language}</Language>
      <div className="wrapper--max">
        {language === "español" ? <Hero /> : <HeroEN />}
      </div>
      <div id="textContainer" className="wrapper--max" onLoad={showText}>
        {language === "español" ? (
          <>
            <p>
              <Quote strong={["sociedad", "legalizamos", "perversiones"]}>
                Como sociedad, a menudo legalizamos nuestras perversiones y
                castigamos lo que nos cura.
              </Quote>
              Para hacer frente a nuestra confusión, el psicoanálisis recomienda
              la realización de nuestro inconsciente colectivo en nuestro
              consciente a través de la{" "}
              <Quote circle={["sublimacíon"]}>sublimacíon.</Quote> Mientras que
              esta canalización de nuestra oscuridad en la creatividad puede
              funcionar como una salida para la catarsis, nuestra brújula moral
              sigue siendo ambigua.{" "}
              <Quote
                circle={["contradicciones"]}
                strong={["contradicciones", "mundo", "engañoso"]}
                orange={["contradicciones", "engañoso"]}
              >
                Bajo Naranja apunta a las contradicciones de un mundo cada vez
                más engañoso donde el Internet es real y las noticias son
                falsas, donde el medio confunde el mensaje.
              </Quote>
            </p>
            <Image source="skull.png" />
            <p>
              Mientras que antes prohibíamos el ateísmo, la poliamoría, el
              mestizaje y la pornografía, hoy en día estas prácticas florecen.
              Para una sociedad de mente abierta, la comprensión de la
              injusticia de estos antiguos tabúes logra un paso hacia la{" "}
              <Quote strong={["libertad."]} orange={["libertad."]}>
                libertad.
